import React, { useState } from "react";
import Footer from "../components/footer";
import { createGlobalStyle } from "styled-components";
import PropTypes from "prop-types";
import { useDispatch, connect } from "react-redux";
import axios from "axios";
import { dispatchLogin } from "./../../store/actions/thunks/authAction";

import { isEmpty } from "../utils/validation/Validation";
import { useSelector } from "react-redux";

const GlobalStyles = createGlobalStyle`
  header#myHeader.navbar.sticky.white {
    background: #403f83;
    border-bottom: solid 1px #403f83;
  }
  header#myHeader.navbar .search #quick_search{
    color: #fff;
    background: rgba(255, 255, 255, .1);
  }
  header#myHeader.navbar.white .btn, .navbar.white a, .navbar.sticky.white a{
    color: #fff;
  }
  header#myHeader .dropdown-toggle::after{
    color: rgba(255, 255, 255, .5);
  }
  header#myHeader .logo .d-block{
    display: none !important;
  }
  header#myHeader .logo .d-none{
    display: block !important;
  }
  @media only screen and (max-width: 1199px) {
    .navbar{
      background: #403f83;
    }
    .navbar .menu-line, .navbar .menu-line1, .navbar .menu-line2{
      background: #fff;
    }
    .item-dropdown .dropdown a{
      color: #fff !important;
    }
  }
`;
const initialState = {
  email: "",
  password: "",
};
// function Login({ auth: { isLogged, isAdmin } }) {
const Login = () => {
  // const auth = useSelector((state) => state.auth);
  // const { isLogged, isAdmin } = auth;
  const [user, setUser] = useState(initialState);
  const dispatch = useDispatch();

  const { email, password } = user;

  const handleChangeInput = (e) => {
    const { name, value } = e.target;
    setUser({ ...user, [name]: value });
  };
  const handleSubmit = async (e) => {
    e.preventDefault();
    if (isEmpty(email) || isEmpty(password)) {
      // setAlert("Please fill in all fields.", "danger");

      return setUser({
        ...user,
      });
    }
    console.log("in login page above try block");

    try {
      console.log("up");
      // const response = await fetch("http://localhost:2190/user/login", {
      //   method: "POST",
      //   headers: {
      //     "Content-Type": "application/json",
      //   },
      //   body: JSON.stringify({ email, password }), // body data type must match "Content-Type" header
      // });
      // const formData = new FormData();
      // formData.append("email", email);
      // formData.append("password", password);
      // await axios.post("http://localhost:2190/user/login", formData);
      // .then((response) => console.log(response));

      // const res = await axios.post("http://localhost:2190/user/login/", {
      //   email,
      //   password,
      // });
      // setAlert(res.data.msg, "success");
      setUser({ ...user });
      console.log("down");

      localStorage.setItem("firstLogin", true);
      console.log("in login page try block");
      // dispatch(dispatchLogin());
      // navigate("/dashboard");
      // return <Navigate to="/dashboard" />
    } catch (err) {
      console.log("in login page catch block");

      // err?.response?.data?.msg
      // && setAlert(err?.response?.data?.msg, "danger");
      setUser({ ...user });
    }
  };
  return (
    <div>
      <GlobalStyles />

      <section
        className="jumbotron breadcumb no-bg"
        style={{ backgroundImage: `url(${"./img/background/subheader.jpg"})` }}
      >
        <div className="mainbreadcumb">
          <div className="container">
            <div className="row align-items-center">
              <div
                className="col-lg-5 text-light wow fadeInRight"
                data-wow-delay=".5s"
              >
                <div className="spacer-10"></div>
                <h1>Create, sell or collect digital items.</h1>
                <p className="lead">
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed
                  do eiusmod tempor incididunt ut labore et dolore magna aliqua
                  ut enim.
                </p>
              </div>
              <div
                className="col-lg-4 offset-lg-2 wow fadeIn"
                data-wow-delay=".5s"
              >
                <div className="box-login">
                  <h3 className="mb10">Sign In</h3>
                  <p>
                    Login using an existing account or create a new account{" "}
                    <span>here</span>.
                  </p>
                  <form
                    name="contactForm"
                    id="contact_form"
                    className="form-border"
                    onSubmit={handleSubmit}
                  >
                    <div className="field-set">
                      <input
                        type="text"
                        name="email"
                        id="email"
                        className="form-control"
                        placeholder="email"
                        value={email}
                        onChange={handleChangeInput}
                      />
                    </div>

                    <div className="field-set">
                      <input
                        type="password"
                        name="password"
                        id="password"
                        className="form-control"
                        placeholder="password"
                        value={password}
                        onChange={handleChangeInput}
                      />
                    </div>

                    <div className="field-set">
                      <input
                        type="submit"
                        id="send_message"
                        value="Submit"
                        className="btn btn-main btn-fullwidth color-2"
                      />
                    </div>

                    <div className="clearfix"></div>

                    <div className="spacer-single"></div>
                    <ul className="list s3">
                      <li>Login with:</li>
                      <li>
                        <span>Facebook</span>
                      </li>
                      <li>
                        <span>Google</span>
                      </li>
                    </ul>
                  </form>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>

      <Footer />
    </div>
  );
};

// Login.propTypes = {
//   auth: PropTypes.object.isRequired,
// };

// const mapStateToProps = (state) => ({
//   auth: state.auth,
// });
// export default connect(mapStateToProps)(Login);
export default Login;
